  def zzScanError(errorCode: Int): Unit = {
    var message = ""
    try {
      message = ZZ_ERROR_MSG(errorCode)
    }
    catch {
      case e: ArrayIndexOutOfBoundsException => message = ZZ_ERROR_MSG(ZZ_UNKNOWN_ERROR)
    }

    throw new Error(message)
  } 


  /**
   * Pushes the specified amount of characters back into the input stream.
   *
   * They will be read again by then next call of the scanning method
   *
   * @param number  the number of characters to be read again.
   *                This number must not be greater than yylength()!
   */
 def yypushback(number: Int): Unit = {
    if ( number > yylength() )
      zzScanError(ZZ_PUSHBACK_2BIG)

    zzMarkedPos -= number
  }


  /**
   * Resumes scanning until the next regular expression is matched,
   * the end of input is encountered or an I/O-Error occurs.
   *
   * @return      the next token
   */
 @throws[java.io.IOException]("if any I/O-Error occurs")
 def yylex(): Object = {
    var zzInput = -1
    var zzAction = -1

    // cached fields:
    var zzCurrentPosL = -1
    var zzMarkedPosL = -1
    var zzEndReadL = zzEndRead
    var zzBufferL = zzBuffer
    val zzCMapL = ZZ_CMAP

    val zzTransL: Array[Int] = ZZ_TRANS
    val zzRowMapL: Array[Int] = ZZ_ROWMAP
    val zzAttrL: Array[Int] = ZZ_ATTRIBUTE

    var ret: Object = null

    while ((ret == null) && !zzAtEOF) {
      zzMarkedPosL = zzMarkedPos

      yychar += zzMarkedPosL-zzStartRead

      zzAction = -1

      zzCurrentPosL = zzMarkedPosL
      zzCurrentPos = zzMarkedPosL
      zzStartRead = zzMarkedPosL
  
      zzState = ZZ_LEXSTATE(zzLexicalState)

      // set up zzAction for empty match case:
      var zzAttributes = zzAttrL(zzState)
      if ( (zzAttributes & 1) == 1 ) {
        zzAction = zzState
      }


      breakable {
        while (true) {

          if (zzCurrentPosL < zzEndReadL) {
            zzInput = Character.codePointAt(zzBufferL, zzCurrentPosL, zzEndReadL)
            zzCurrentPosL += Character.charCount(zzInput)
          }
          else if (zzAtEOF) {
            zzInput = YYEOF
            break
          }
          else {
            // store back cached positions
            zzCurrentPos  = zzCurrentPosL
            zzMarkedPos   = zzMarkedPosL
            val eof = zzRefill()
            // get translated positions and possibly new buffer
            zzCurrentPosL  = zzCurrentPos
            zzMarkedPosL   = zzMarkedPos
            zzBufferL      = zzBuffer
            zzEndReadL     = zzEndRead
            if (eof) {
              zzInput = YYEOF
              break
            }
            else {
              zzInput = Character.codePointAt(zzBufferL, zzCurrentPosL, zzEndReadL)
              zzCurrentPosL += Character.charCount(zzInput)
            }
          }
          val zzNext = zzTransL(zzRowMapL(zzState) + zzCMapL(zzInput))
          if (zzNext == -1) break
          zzState = zzNext

          zzAttributes = zzAttrL(zzState)
          if ( (zzAttributes & 1) == 1 ) {
            zzAction = zzState
            zzMarkedPosL = zzCurrentPosL
            if ( (zzAttributes & 8) == 8 ) break
          }

        }
      }

      // store back cached position
      zzMarkedPos = zzMarkedPosL

      ret = if (zzInput == YYEOF && zzStartRead == zzCurrentPos) {
        zzAtEOF = true
        null
      }
      else {
        (if (zzAction < 0) zzAction else ZZ_ACTION(zzAction)) match {
          case 1 => 
             printDebug("CATCHALL"); tok()
          case 62 => null // noop
          case 2 => 
             printDebug("SYMBOL"); tok()
          case 63 => null // noop
          case 3 => 
             printDebug("PUNC"); tok()
          case 64 => null // noop
          case 4 => 
             printDebug("REPEATED_PUNC"); tok()
          case 65 => null // noop
          case 5 => 
             printDebug("NEWLINE"); if (tokenizeWhitespace || tokenizeNewline) tok() else null
          case 66 => null // noop
          case 6 => 
             printDebug("ELLIPSIS"); if(normalizeEllipsis) tok(NORMALIZED_ELLIPSIS) else tok()
          case 67 => null // noop
          case 7 => 
             printDebug("WORD")
               if(normalizeHtmlAccent){
                 val matched = yytext()
                 var tokenString = ""
                 var startIdx = matched.indexOf('&')
                 var lastEnd = 0
                 while(startIdx != -1){
                   // these are of the form "&Eacute;"; grab just the E
                   val endIdx = matched.indexOf(';', lastEnd)
                   tokenString += matched.substring(lastEnd, startIdx) + yycharat(startIdx+1)
                   lastEnd = endIdx+1
                   startIdx = matched.indexOf('&', lastEnd)
                 }
                 tokenString += matched.substring(lastEnd)
                 tok(tokenString)
               }
               else tok()
          case 68 => null // noop
          case 8 => 
             printDebug("NUMBER"); tok()
          case 69 => null // noop
          case 9 => 
             printDebug("QUOTE"); if(normalizeQuotes) tok(NORMALIZED_QUOTE) else tok()
          case 70 => null // noop
          case 10 => 
             printDebug("DASH"); if(normalizeDash) tok(NORMALIZED_DASH) else tok()
          case 71 => null // noop
          case 11 => 
             printDebug("AP2"); if(normalizeApostrophe) tok(NORMALIZED_APOSTROPHE) else tok()
          case 72 => null // noop
          case 12 => 
             printDebug("WHITESPACE"); if(tokenizeWhitespace) tok() else null
          case 73 => null // noop
          case 13 => 
             printDebug("CURRENCY")
               if(normalizeCurrency){
                 yytext() match{
                   case "\u00A2" => tok(NORMALIZED_CENTS)
                   case _ => tok(NORMALIZED_DOLLAR)
                 }
               }
               else tok()
          case 74 => null // noop
          case 14 => 
             printDebug("FRACTION")
               if(normalizeFractions){
                 yytext() match{
                   case "\u00BC" => tok(NORMALIZED_ONE_QUARTER)
                   case "\u00BD" => tok(NORMALIZED_ONE_HALF)
                   case "\u00BE" => tok(NORMALIZED_THREE_QUARTERS)
                   case "\u2153" => tok(NORMALIZED_ONE_THIRD)
                   case "\u2154" => tok(NORMALIZED_TWO_THIRDS)
                   case _ => tok()
                 }
               }
               else tok()
          case 75 => null // noop
          case 15 => 
             printDebug("MDASH"); if(normalizeMDash) tok(NORMALIZED_MDASH) else tok()
          case 76 => null // noop
          case 16 => 
             printDebug("GARB"); null
          case 77 => null // noop
          case 17 => 
             printDebug("APWORD"); tok()
          case 78 => null // noop
          case 18 => 
             printDebug("ESCAPED_SLASH"); if(unescapeSlash) tok(UNESCAPED_SLASH) else tok()
          case 79 => null // noop
          case 19 => 
             printDebug("ESCAPED_ASTERISK"); if(unescapeAsterisk) tok(UNESCAPED_ASTERISK) else tok()
          case 80 => null // noop
          case 20 => 
            // general lookahead, find correct zzMarkedPos
            { var zzFState = 1
              var zzFPos = zzStartRead
              if (zzFin.length <= zzBufferL.length) { zzFin = new Array[Boolean](zzBufferL.length+1) }
              val zzFinL = zzFin
              while (zzFState != -1 && zzFPos < zzMarkedPos) {
                zzFinL(zzFPos) = ((zzAttrL(zzFState) & 1) == 1)
                zzInput = Character.codePointAt(zzBufferL, zzFPos, zzMarkedPos)
                zzFPos += Character.charCount(zzInput)
                zzFState = zzTransL( zzRowMapL(zzFState) + zzCMapL(zzInput) )
              }
              if (zzFState != -1) { zzFinL(zzFPos) = ((zzAttrL(zzFState) & 1) == 1) } 
              zzFPos += 1
              while (zzFPos <= zzMarkedPos) {
                zzFinL(zzFPos) = false
                zzFPos += 1
              }

              zzFState = 2
              zzFPos = zzMarkedPos
              while (!zzFinL(zzFPos) || (zzAttrL(zzFState) & 1) != 1) {
                zzInput = Character.codePointBefore(zzBufferL, zzFPos, zzStartRead)
                zzFPos -= Character.charCount(zzInput)
                zzFState = zzTransL( zzRowMapL(zzFState) + zzCMapL(zzInput) )
              }
              zzMarkedPos = zzFPos
            }
             printDebug("EMOTICON"); tok()
          case 81 => null // noop
          case 21 => 
            // lookahead expression with fixed base length
            zzMarkedPos = Character.offsetByCodePoints(zzBufferL, zzStartRead, zzEndRead - zzStartRead, zzStartRead, 2)
             printDebug("SINGLE_INITIAL"); tok()
          case 82 => null // noop
          case 22 => 
             printDebug("ABBREVS"); tok()
          case 83 => null // noop
          case 23 => 
            // general lookahead, find correct zzMarkedPos
            { var zzFState = 3
              var zzFPos = zzStartRead
              if (zzFin.length <= zzBufferL.length) { zzFin = new Array[Boolean](zzBufferL.length+1) }
              val zzFinL = zzFin
              while (zzFState != -1 && zzFPos < zzMarkedPos) {
                zzFinL(zzFPos) = ((zzAttrL(zzFState) & 1) == 1)
                zzInput = Character.codePointAt(zzBufferL, zzFPos, zzMarkedPos)
                zzFPos += Character.charCount(zzInput)
                zzFState = zzTransL( zzRowMapL(zzFState) + zzCMapL(zzInput) )
              }
              if (zzFState != -1) { zzFinL(zzFPos) = ((zzAttrL(zzFState) & 1) == 1) } 
              zzFPos += 1
              while (zzFPos <= zzMarkedPos) {
                zzFinL(zzFPos) = false
                zzFPos += 1
              }

              zzFState = 4
              zzFPos = zzMarkedPos
              while (!zzFinL(zzFPos) || (zzAttrL(zzFState) & 1) != 1) {
                zzInput = Character.codePointBefore(zzBufferL, zzFPos, zzStartRead)
                zzFPos -= Character.charCount(zzInput)
                zzFState = zzTransL( zzRowMapL(zzFState) + zzCMapL(zzInput) )
              }
              zzMarkedPos = zzFPos
            }
             printDebug("CONTRACTED_WORD"); tok()
          case 84 => null // noop
          case 24 => 
             printDebug("EMAIL"); tok()
          case 85 => null // noop
          case 25 => 
             printDebug("DASHED_PREFIX_WORD")
               if(tokenizeAllDashedWords){
                 val word = yytext()
                 yypushback(yylength() - word.indexOf("-"))
               }
               tok()
          case 86 => null // noop
          case 26 => 
            // lookahead expression with fixed lookahead length
            zzMarkedPos = Character.offsetByCodePoints(zzBufferL, zzStartRead, zzEndRead - zzStartRead, zzMarkedPos, -1)
             printDebug("CURRENCY"); if(normalizeCurrency) tok(NORMALIZED_DOLLAR) else tok()
          case 87 => null // noop
          case 27 => 
            // lookahead expression with fixed lookahead length
            zzMarkedPos = Character.offsetByCodePoints(zzBufferL, zzStartRead, zzEndRead - zzStartRead, zzMarkedPos, -1)
             printDebug("CONSONANT_NON_ABBREVS"); tok()
          case 88 => null // noop
          case 28 => 
             printDebug("HASHTAG"); tok()
          case 89 => null // noop
          case 29 => 
             printDebug("ORDINALS"); tok()
          case 90 => null // noop
          case 30 => 
             printDebug("DECADE"); tok()
          case 91 => null // noop
          case 31 => 
            // lookahead expression with fixed lookahead length
            zzMarkedPos = Character.offsetByCodePoints(zzBufferL, zzStartRead, zzEndRead - zzStartRead, zzMarkedPos, -1)
             printDebug("ELLIPSIS"); if(normalizeEllipsis) tok(NORMALIZED_ELLIPSIS) else tok()
          case 92 => null // noop
          case 32 => 
            // lookahead expression with fixed lookahead length
            zzMarkedPos = Character.offsetByCodePoints(zzBufferL, zzStartRead, zzEndRead - zzStartRead, zzMarkedPos, -1)
             printDebug("CONTRACTION"); tok()
          case 93 => null // noop
          case 33 => 
             printDebug("NUMBER2"); tok()
          case 94 => null // noop
          case 34 => 
             printDebug("ATUSER"); tok()
          case 95 => null // noop
          case 35 => 
             printDebug("URL2"); tok()
          case 96 => null // noop
          case 36 => 
             printDebug("FILENAME"); tok()
          case 97 => null // noop
          case 37 => 
             printDebug("SGML"); if(tokenizeSgml) tok() else null
          case 98 => null // noop
          case 38 => 
             printDebug("HTML_SYMBOL")
               if(normalizeHtmlSymbol){
                 val matched = yytext()
                 tok(htmlSymbolMap.getOrElse(matched, matched))
               }
               else tok()
          case 99 => null // noop
          case 39 => 
            // lookahead expression with fixed lookahead length
            zzMarkedPos = Character.offsetByCodePoints(zzBufferL, zzStartRead, zzEndRead - zzStartRead, zzMarkedPos, -1)
             printDebug("INITIALS2"); tok()
          case 100 => null // noop
          case 40 => 
             printDebug("INITIALS"); tok()
          case 101 => null // noop
          case 41 => 
            // lookahead expression with fixed base length
            zzMarkedPos = Character.offsetByCodePoints(zzBufferL, zzStartRead, zzEndRead - zzStartRead, zzStartRead, 3)
             printDebug("LATIN2"); tok()
          case 102 => null // noop
          case 42 => 
            // lookahead expression with fixed base length
            zzMarkedPos = Character.offsetByCodePoints(zzBufferL, zzStartRead, zzEndRead - zzStartRead, zzStartRead, 3)
             printDebug("NOABBREV"); tok()
          case 103 => null // noop
          case 43 => 
             printDebug("URL3"); tok()
          case 104 => null // noop
          case 44 => 
             printDebug("ESCAPED_ASTERISK2"); if(unescapeAsterisk) tok(UNESCAPED_ASTERISK2) else tok()
          case 105 => null // noop
          case 45 => 
            // lookahead expression with fixed lookahead length
            zzMarkedPos = Character.offsetByCodePoints(zzBufferL, zzStartRead, zzEndRead - zzStartRead, zzMarkedPos, -1)
             printDebug("CAPS"); tok()
          case 106 => null // noop
          case 46 => 
             printDebug("HTMLCHAR"); tok()
          case 107 => null // noop
          case 47 => 
             printDebug("AMPERSAND"); if(normalizeAmpersand || normalizeHtmlSymbol) tok(NORMALIZED_AMPERSAND) else tok()
          case 108 => null // noop
          case 48 => 
            // lookahead expression with fixed lookahead length
            zzMarkedPos = Character.offsetByCodePoints(zzBufferL, zzStartRead, zzEndRead - zzStartRead, zzMarkedPos, -1)
             printDebug("DASHED_PREFIX_WORD")
               if(tokenizeAllDashedWords){
                 val word = yytext()
                 yypushback(yylength() - word.indexOf("-"))
